import {useParams} from "react-router-dom";
import {getDetailsByID} from "../services/openlib-services";
import {profile} from "../services/users-services";
import React, {useEffect, useState} from "react";

const COVER_SOURCE = "https://covers.openlibrary.org/b/id"

const ResultDetailed = () => {
    const {key} = useParams();

    const [details, setDetails] = useState({});
    const fetchDetails = async () => {
        const response = await getDetailsByID(key);
        setDetails(response);
    }
    useEffect(() => {
        fetchDetails();
    }, []);



    return(
        <>
            <h4>Details</h4>
            {details.covers ? details.covers.map(cover =>
                <li>{cover}</li>) : <img src="none"/>}
            {JSON.stringify(details)}

        </>
    )
}

export default ResultDetailed;
